  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Wheeler National
  Wildlife Refuge outlines Refuge accomplishments from August to October 1940. The
  report begins by summarizing the personnel, weather, water conditions, and fires.
  Wildlife- including water birds, upland game birds, fur bearing animals- is also
  covered. The Refuge development discusses physical development, plantings, collections,
  cooperative farming. The public relations section of the report describes recreational
  relations and violations. Economic uses of the refuge including, crop returns, TVA
  return, and commercial fishing are discussed. Field investigations follow. Photos
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
